import React from "react";
import "../styles/header.css";
const Header = () => {
    return (
        <header className="header">
            <nav className="nav container">
                <a href="index.html" className="nav__logo">Grzegorz i Julia</a>

                .nav
            </nav>
        </header>
    )
}

export default Header
